import React from 'react';
import './Services.css';

function Services() {
  const services = [
    {
      icon: 'üåê',
      title: 'Web Development',
      description: 'Creating fast, secure, and responsive websites tailored to your business goals.',
    },
    {
      icon: 'üì±',
      title: 'App Development',
      description: 'Building feature-rich and user-friendly mobile applications for iOS and Android.',
    },
  ];

  return (
    <div className="services">
      <h1>Our Services</h1>
      <div className="service-cards">
        {services.map((service, index) => (
          <div className="card" key={index}>
            <div className="icon">{service.icon}</div>
            <h2>{service.title}</h2>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Services;
